const Card = ({monster, index}) => {
    const {name, email} = monster;

    return (
        <div key={index} className='card-container' >
            <img 
                alt={`Monster ${name}`} 
                src={`https://robohash.org/${index}?set=set2&size=180x180`} 
            />
            <h2>{name}</h2>
            <p>{email}</p>
        </div>
    );
};

